Bilibili评论区模拟：任何在本页面发送的评论均会变成“好好好”
<script>
"use strict";
window.RLQ.push([["jquery"], () => {
    $(function () {
        if (mw.config.get("wgPageName") === '敖厂长') Array.prototype.slice.call(document.getElementsByClassName("comment-text")).forEach(a => { a.innerText = "好好好" })
    });
}]);
</script>

问:在萌百什么是永恒的

答:临时的半保护措施

一个编辑者去萌娘百科创建一个条目，但又担心条目安全。
星海子解释：&quot; 站务人员将保证你的条目安全。&quot;
用户：&quot; 万一站务人员都垮了呢？&quot;
星海子解释：&quot; 那腾讯云的备份服务器将保证你的条目安全。&quot;
用户：&quot; 那万一腾讯云也垮了呢？&quot;
星海子：&quot; 运维会保证你的条目安全。&quot;
用户：&quot; 那万一运维也垮了呢？&quot;
星海子怒了：&quot; 难道为了这么美妙的事情，你都不舍得这篇条目吗？&quot;
